(208,1,'전사','후니뮤직, 1월 캠페인 진행 \'인기 작곡가 히트곡 저작권을 내품에~\'','<p>\r\n\r\n<p style=\" margin: 0px 0px 30px; font-size: 18px; line-height: 32px; font-family: &quot;IBM Plex Sans KR&quot;, &quot;IBM Plex Sans KR&quot;, 맑은고딕, &quot;Malgun Gothic&quot;, 돋움, Dotum, 굴림, Gulim, AppleGothic, sans-serif; letter-spacing: -1px\">[스포츠서울 이지석기자]가요계 최정상급 톱스타, 유명 작곡가들과 저작권을 공유할 수 있는 기회가 활짝 열렸다.</p><p style=\" margin: 0px 0px 30px; font-size: 18px; line-height: 32px; font-family: &quot;IBM Plex Sans KR&quot;, &quot;IBM Plex Sans KR&quot;, 맑은고딕, &quot;Malgun Gothic&quot;, 돋움, Dotum, 굴림, Gulim, AppleGothic, sans-serif; letter-spacing: -1px\">저작권과 공유경제에 대한 관심이 어느 때보다 뜨거운 가운데&nbsp;</p><p style=\" margin: 0px 0px 30px; font-size: 18px; line-height: 32px; font-family: &quot;IBM Plex Sans KR&quot;, &quot;IBM Plex Sans KR&quot;, 맑은고딕, &quot;Malgun Gothic&quot;, 돋움, Dotum, 굴림, Gulim, AppleGothic, sans-serif; letter-spacing: -1px\">국내에서 융합문화플랫폼으로 주목받고 있는 저작권 공유 플랫폼 ‘뮤지코인’이 음악저작권 생태계를 활성화하기 위한 캠페인&nbsp;</p><p style=\" margin: 0px 0px 30px; font-size: 18px; line-height: 32px; font-family: &quot;IBM Plex Sans KR&quot;, &quot;IBM Plex Sans KR&quot;, 맑은고딕, &quot;Malgun Gothic&quot;, 돋움, Dotum, 굴림, Gulim, AppleGothic, sans-serif; letter-spacing: -1px\">‘베터 뮤직 에코 시스템(BETTER MUSIC ECOSYSTEM)’을 펼친다.</p><p style=\" margin: 0px 0px 30px; font-size: 18px; line-height: 32px; font-family: &quot;IBM Plex Sans KR&quot;, &quot;IBM Plex Sans KR&quot;, 맑은고딕, &quot;Malgun Gothic&quot;, 돋움, Dotum, 굴림, Gulim, AppleGothic, sans-serif; letter-spacing: -1px\">세계를 휩쓸고 있는 K팝 열풍의 원동력이 된 작곡가 박근태, 이동원, 이단옆차기 박장근 작곡가가 참여해&nbsp;</p><p style=\" margin: 0px 0px 30px; font-size: 18px; line-height: 32px; font-family: &quot;IBM Plex Sans KR&quot;, &quot;IBM Plex Sans KR&quot;, 맑은고딕, &quot;Malgun Gothic&quot;, 돋움, Dotum, 굴림, Gulim, AppleGothic, sans-serif; letter-spacing: -1px\">자신의 소중한 저작권을 대중과 공유하는 자리를 마련한다.</p>\r\n<br /></p>','2024-01-17',5,'0'),
(209,1,'전사','후니뮤직, “음악 저작권 공유로 아티스트 응원해요”','<p>\r\n\r\n<span style=\"color: rgb(72, 71, 71); font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 굴림, Gulim, 돋움, dotum, Helvetica, sans-serif; font-size: 19px; letter-spacing: -1px; background-color: rgb(255, 255, 255)\">지난해 대중음악 생태계는 전례 없는 감염병 사태로 뿌리째 흔들렸다.&nbsp;</span></p>\r\n<p><p><span style=\"color: rgb(72, 71, 71); font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 굴림, Gulim, 돋움, dotum, Helvetica, sans-serif; font-size: 19px; letter-spacing: -1px; background-color: rgb(255, 255, 255)\">각종 콘서트 등 오프라인 공연이 전면 중단됐고, 가수와 팬들은 얼굴을 직접 마주하지 않는 온라인으로 발길을 돌렸다.&nbsp;</span></p><p><span style=\"color: rgb(72, 71, 71); font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 굴림, Gulim, 돋움, dotum, Helvetica, sans-serif; font-size: 19px; letter-spacing: -1px; background-color: rgb(255, 255, 255)\">‘언택트’(비대면)라는 새로운 소통 창구가 생기면서 음악 소비 트렌드도 크게 바뀌었다.&nbsp;</span></p><p><span style=\"color: rgb(72, 71, 71); font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 굴림, Gulim, 돋움, dotum, Helvetica, sans-serif; font-size: 19px; letter-spacing: -1px; background-color: rgb(255, 255, 255)\">여기에 유튜브와 다양한 OTT(온라인 스트리밍 서비스) 등 새로운 플랫폼이 음악 소비와 유통의 강자로 떠올랐다.</span></p><br style=\"color: rgb(72, 71, 71); font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 굴림, Gulim, 돋움, dotum, Helvetica, sans-serif; font-size: 19px; letter-spacing: -1px; background-color: rgb(255, 255, 255)\" /><span style=\"color: rgb(72, 71, 71); font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 굴림, Gulim, 돋움, dotum, Helvetica, sans-serif; font-size: 19px; letter-spacing: -1px; background-color: rgb(255, 255, 255)\">이에 따라 스트리밍 시장도 커졌다.&nbsp;</span></p>\r\n<p><span style=\"color: rgb(72, 71, 71); font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 굴림, Gulim, 돋움, dotum, Helvetica, sans-serif; font-size: 19px; letter-spacing: -1px; background-color: rgb(255, 255, 255)\">실제로 작사·작곡·편곡 등 저작권 신탁단체인 한국음악저작권협회(한음저협)에 따르면&nbsp;</span><span style=\"background-color: rgb(255, 255, 255); color: rgb(72, 71, 71); font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 굴림, Gulim, 돋움, dotum, Helvetica, sans-serif; font-size: 19px; letter-spacing: -1px;\">지난해 말 기준 음악 저작권 징수액은 약 2460억원이다.&nbsp;</span></p>\r\n<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(72, 71, 71); font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 굴림, Gulim, 돋움, dotum, Helvetica, sans-serif; font-size: 19px; letter-spacing: -1px;\">2019년 2208억원보다 11.4% 늘어났다.&nbsp;</span></p>\r\n<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(72, 71, 71); font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 굴림, Gulim, 돋움, dotum, Helvetica, sans-serif; font-size: 19px; letter-spacing: -1px;\">한음저협은 “유튜브와 OTT 등 온라인 서비스 시장이 커지면서 저작권 징수액도 증가했다”고 밝혔다.&nbsp;</span></p>\r\n<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(72, 71, 71); font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 굴림, Gulim, 돋움, dotum, Helvetica, sans-serif; font-size: 19px; letter-spacing: -1px;\">신종 코로나바이러스 감염병(코로나19) 확산 여파로 인한 가요계 불황 속에서도 음악에 대한 소비 욕구가 커져가고 있는 셈이다.</span></p>','2024-01-17',2,'0'),
(210,1,'전사','K팝, 듣지만 말고 돈도 벌자...음악 저작권 투자','<p>\r\n\r\n<span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">“올해의 투자, 음악 저작권이 곧 연금이 된다.\"</span><br style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\" /><br style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\" /><span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">도대체 월급은 언제 오르고 내 집마련의 꿈은 언제 이룰 수 있을까.&nbsp;</span></p>\r\n<p><span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">코로나19 확산으로 세계 경제가 침체기에 접어들면서 저금리 기조가 지속될 것으로 보인다.&nbsp;</span></p>\r\n<p><span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">기준금리가 0.5%에 불과하다 보니 은행 예·적금도 1%대에 머문다.&nbsp;</span></p>\r\n<p><span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">불안한 경제상황 속에서 이제 재테크, 투자를 해야만 하는 이유는 더 이상 말할 필요도 없다.&nbsp;</span></p>\r\n<p><span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">점점 다양하게 확산되는 투자 열풍, 그렇다면 요즘 주목받는 투자는 뭘까?</span>\r\n<br /></p>','2024-01-17',4,'0'),
(211,1,'전사','\"노래의 주인이 되어주세요\" IP금융 아이콘 꿈꾸는 후니뮤직','<p>\r\n\r\n<span style=\"color: rgb(51, 51, 51); font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, &quot;Noto Sans KR&quot;; font-size: 17px\">\"당신이 만일 즐겨듣는 음악의 주인이 되어 돈을 벌 수 있다면?\" 즐거운 상상을 현실로 만든 스타트업이 있다.&nbsp;</span></p>\r\n<p><p><span style=\"color: rgb(51, 51, 51); font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, &quot;Noto Sans KR&quot;; font-size: 17px\">저작권료 공유 플랫폼 업체 \'후니뮤직\'이 주인공이다.</span></p><br style=\"font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, &quot;Noto Sans KR&quot;; color: rgb(51, 51, 51); font-size: 17px\" /><span style=\"color: rgb(51, 51, 51); font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, &quot;Noto Sans KR&quot;; font-size: 17px\">설립 5년차를 맞이한 후니뮤직 유일무이한 사업 모델로 유저 뿐 아니라 벤처캐피탈(VC)의 마음을 사로 잡았다.&nbsp;</span></p>\r\n<p><p><span style=\"color: rgb(51, 51, 51); font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, &quot;Noto Sans KR&quot;; font-size: 17px\">올해에는 글로벌로 활로를 넓히고, 저작권 펀딩을 통해 사업 영역을 더욱 확장하겠다는 계획이다.</span></p><br style=\"font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, &quot;Noto Sans KR&quot;; color: rgb(51, 51, 51); font-size: 17px\" /><strong style=\"font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, &quot;Noto Sans KR&quot;; font-size: 17px; color: rgb(17, 17, 17); vertical-align: baseline; background: transparent; list-style: none\">◇ 작사 경험 토대 문화+금융 결합 구상…음악 생태계 선순환 목표</strong><br style=\"font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, &quot;Noto Sans KR&quot;; color: rgb(51, 51, 51); font-size: 17px\" /><br style=\"font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, &quot;Noto Sans KR&quot;; color: rgb(51, 51, 51); font-size: 17px\" /><span style=\"color: rgb(51, 51, 51); font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, &quot;Noto Sans KR&quot;; font-size: 17px\">후니뮤직은 창작자에게 저작권 일부를 양도 받은 뒤 유저들에게 옥션을 통해 거래할 수 있도록 플랫폼을 제공한다.&nbsp;</span></p>\r\n<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, &quot;Noto Sans KR&quot;; font-size: 17px\">저작권의 소유자가 되면 주식에서 배당을 받듯이 매월 금액을 수취할 수 있다.</span>\r\n<br /></p>','2024-01-17',9,'0'),
(212,1,'전사','[Y메이커] \"리스너·창작자 상생!\" 후니뮤직 손흥민 대표의 뜻','<p>\r\n\r\n<b style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">[Y메이커]는 신뢰와 정통의 보도 전문 채널 YTN의&nbsp;</b></p>\r\n<p><b style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">차별화 된 엔터뉴스 YTN STAR가 연재하는 이 시대의 진정한 메이커스를 취재한 인터뷰입니다.&nbsp;</b></p>\r\n<p><b style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">4차 산업혁명이 도래한 이때 창의적인 콘텐츠의 수요는 더욱 커지고 있습니다.&nbsp;</b></p>\r\n<p><b style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">이에 따라 수요를 창출하는 메이커스의 활약과 가치는 더욱 커질 것으로 기대됩니다.&nbsp;</b></p>\r\n<p><b style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">이번 주인공은 [음악 저작권 시장의 상생] 메이커, 후니뮤직 손흥민 대표입니다.</b>\r\n<br /></p>\r\n<p>\r\n\r\n<span style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">\"너도, 나도 음악 저작권자가 될 수 있다. 모두가 윈-윈(win-win)하는 음악 생태계를 만들고 싶습니다\".</span><br style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\" /><br style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\" /><span style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">음악 저작권료 공유 플랫폼인 \'후니뮤직\' 손흥민 대표는&nbsp;</span></p>\r\n<p><span style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">음악을 창작하는 사람은 물론, 듣는 사람, 즉 리스너도 청취자로서의 가치를 인정받아야 한다고 말했다.&nbsp;</span></p>\r\n<p><span style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">그것을 토대로 개개인이 저작권을 소유하고 수익을 얻어가는 구조를 개발해 새로운 형태의 음악 시장을 개척해나가고 있었다.</span>\r\n<br /></p>','2024-01-17',2,'0'),
(213,1,'전사','[K-POP 공유 문화] 국내에서 가장 높은 포지셔닝이 음악 저작권이다','<p>\r\n\r\n<span style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">손 대표는 \"벤처사업가로서 새로운 사업에 대해 고민하고 있었다.&nbsp;</span></p>\r\n<p><p><span style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">그러던 2017년, 시장 규모가 큰 K팝과 금융을 연관 지어 생각하다 보니 저작권 관련 사업이 떠올랐다.&nbsp;</span></p><p><span style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">신선한 걸 시도해보고 싶었다\"라고 창업 계기를 설명했다.</span></p><br style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\" /><span style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">손 대표는 \"4차 산업혁명이 도래하면서 전체적인 산업 형태가 유형(有形)에서 무형(無形)으로 바뀌는 추세다.&nbsp;</span></p>\r\n<p><p><span style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">그 중 하나가 지적 재산권인데 국내에서 가장 높은 포지셔닝이 음악 저작권이다\"라며&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); font-size: 17px; letter-spacing: -0.64px;\">\"한국 음악 저작권 시장은 좋지 않은 편이다.&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); font-size: 17px; letter-spacing: -0.64px;\">일본과 비교했을 때 15분의 1에 불과하다. 저작권 인식이 열악하며 강화되지 않은 상황\"이라고 지적했다.&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); font-size: 17px; letter-spacing: -0.64px;\">이는 창작자들의 생태계가 좋지 못하다는 뜻이며 좋은 음악을 생산해내는 만큼 돌려받지 못한다는 것.</span></p><br style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\" /><span style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">이에 손 대표는 창작자의 수고에 목돈 정도의 도움이 되고자 이 같은 사업을 구상했고 실천했다.&nbsp;</span></p>\r\n<p><span style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">이 가운데서 창작자뿐만 아니라 해당 음악을 듣는 리스너들도 그 행위를 인정받고자 저작권 공유 시스템을 개발했다.&nbsp;</span></p>\r\n<p><span style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">손 대표는 \"내가 좋아하는 가수의 음악을 무수한 횟수로 듣고 인기가 많아지는 데 일조하며&nbsp;</span><span style=\"background-color: rgb(255, 255, 255); font-size: 17px; letter-spacing: -0.64px;\">그 결과, 저작권으로 돈을 얻게 되는 구조.&nbsp;</span></p>\r\n<p><span style=\"background-color: rgb(255, 255, 255); font-size: 17px; letter-spacing: -0.64px;\">이런 식으로 창작자와 리스너 양쪽 다 수익을 얻게 하는 선순환 형태를 만들고 싶었다\"라고 사업 취지를 설명했다.</span></p>','2024-01-17',10,'0'),
(214,1,'전사','[아티스트/저작권협회] \"우리 회사 슬로건이 \'Better Music ECO System\'이다. 건강한 음악 생태계가 되길 바랄 뿐\"','<p>\r\n\r\n<span style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">후니뮤직의 행보에 아티스트와 저작권협회 모두 반기는 상황이다.&nbsp;</span></p>\r\n<p><p><span style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">손 대표에 따르면 대부분의 아티스트가 자신의 곡 저작권료 공유에 협조적인 편이다.&nbsp;</span></p><p><span style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">손 대표는 \"저작권협회 측도 저작권자들의 권익을 우선시하고 보호하는 데 좋은 일이라고 평해준다\"라며 감사해 했다.</span></p><br style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\" /><span style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">후니뮤직을 통한 저작권 공유에서도 장르마다 거래 수준과 크기도 차이가 난다.&nbsp;</span></p>\r\n<p><span style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">거대 팬덤을 거느린 아이돌 음악이 월등히 큰 움직임을 보이며 거래도 활발하다.&nbsp;</span></p>\r\n<p><span style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">이에 손 대표는 \"언더그라운드 음악(인디)들도 인기가 많고 마니아층이 있는 만큼 올해 하반기부터 그들을 위한 후원 파트를 생성해볼 생각이다.</span></p>\r\n<p><span style=\" font-size: 17px; letter-spacing: -0.64px; text-align: left; background-color: rgb(255, 255, 255)\">&nbsp;그들의 음악을 더 적극적으로 소개하고 알려주는 식\"이라고 설명했다.</span>\r\n<br /></p>','2024-01-17',6,'0'),
(215,1,'전사','음악 생태계의 떠오르는 ‘상생’ 투자플랫폼, \"후니뮤직\"','<p>\r\n\r\n<span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">경매 참가자뿐만 아니라 원저작권자도 수익을 얻는다.&nbsp;</span></p>\r\n<p><p><span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">저작권을 나눔으로써 손해를 보는 것이 아니라 오히려 추가적인 수익을 얻게 된다.&nbsp;</span></p><p><span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">후니뮤직이 ‘음악 생태계의 선순환, 상생플랫폼’이라는 평을 받는 것 역시 이 때문이다.</span></p><br id=\"br_11\" style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\" /><span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">3-400곡 이상을 보유한 경력 20년 이상, 국내 대표적인 유명 작곡가의 평균적인 연 저작권료는 대체적으로 1~3억 선에 불과하다.&nbsp;</span></p>\r\n<p><span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">이는 한 산업을 움직이고, 국내 대중 누구나 아는 파급력을 가진 대표격 인물임을 감안하면&nbsp;</span></p>\r\n<p><span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">그 수익은 매우 미미한 수준이다.&nbsp;</span></p>\r\n<p><span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">작곡, 작사가(이하 ‘창작자’라 함)들에게도 작업실 확장, 곡 작업, 제작 및 신규 사업 등 여러가지 자금이 필요한 니즈들이 다양하다.&nbsp;</span></p>\r\n<p><span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">여기에는 수억에서 많게는 수십 억대의 자본금이 필요하다.</span>\r\n<br /></p>\r\n<p><span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\"><br /></span></p>','2024-01-17',4,'0'),
(216,2,'전사','불안한 시대의 새로운 대안, 음악 저작권','<p>\r\n\r\n<span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">투자 트렌드가 변하면서 개인들은 예·적금을 떠나 주식, 펀드, 개인 간(P2P)금융, 크라우드펀딩 등 다양한 투자처를 찾는다.&nbsp;</span></p>\r\n<p><span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">2018년도 각광을 받았던 P2P금융은 2030세대를 중심으로 빠르게 확산되며 대세감을 형성했다.&nbsp;</span></p>\r\n<p><span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">그러나 사기 및 업체 부실 등으로 인해 외면을 받았고, 이후 투자자들의 시선은 크라우드 펀딩으로 옮겨졌다.&nbsp;</span></p>\r\n<p><span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">지난 2016년부터 영화 ‘판도라’와 ‘너의 이름은’ 등&nbsp;</span></p>\r\n<p><span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">영화 제작·마케팅 비용을 마련하기 위해 진행된 크라우드 펀딩이 잇따라 큰 수익을 내면서 영화 펀딩이 ‘이색 재테크’로 각광받았다.&nbsp;</span></p>\r\n<p><span style=\"color: rgb(17, 17, 17); font-family: &quot;Noto Sans KR&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, Dotum, 돋움, Arial, Helvetica, sans-serif; font-size: 18px; letter-spacing: -0.75px\">크라우드 펀딩은 2019년도 더 각광받으며 영화뿐만 아니라 각종 문화산업에도 새로운 투자 수단이 됐다.</span>\r\n<br /></p>','2024-01-17',25,'0'),
(218,3,'전사','[2024-01-17] 가격 정보 업데이트 합니다.','<p>참고 바랍니다.</p>','2024-01-17',6,'0'),
(219,3,'전사','[2024-01-17] 거래량 정보 업데이트 합니다.','<p>참고 바랍니다.</p>','2024-01-17',18,'0'),
(221,1,'대표이사','2022년도 상반기 워크숍 안내','<p>안녕하세요.</p>\r\n<p>2022년도 상반기 워크숍을 2022년 02월 01일 진행합니다.</p>\r\n<p>많은 참여 바랍니다.</p>','2024-01-18',1,'0'),
(222,1,'대표이사','2022년도 상반기 워크숍 후기','<p>안녕하세요.</p>\r\n<p>모두들 많은 참여 감사합니다.</p>','2024-01-18',1,'0'),
(223,1,'대표이사','2023년도 상반기 워크숍 안내','<p>\r\n\r\n<p style=\" font-family: &quot;Noto Sans KR&quot;, sans-serif; color: rgb(34, 34, 34); font-size: 14px; text-align: left\">안녕하세요.</p><p style=\" font-family: &quot;Noto Sans KR&quot;, sans-serif; color: rgb(34, 34, 34); font-size: 14px; text-align: left\">2023년도 상반기 워크숍을 2023년 01월 25일 진행합니다.</p><p style=\" font-family: &quot;Noto Sans KR&quot;, sans-serif; color: rgb(34, 34, 34); font-size: 14px; text-align: left\">많은 참여 바랍니다.</p>\r\n<br /></p>','2024-01-18',0,'0'),
(224,1,'대표이사','2023년도 상반기 워크숍 후기','<p>\r\n\r\n<p style=\" font-family: &quot;Noto Sans KR&quot;, sans-serif; color: rgb(34, 34, 34); font-size: 14px; text-align: left\">안녕하세요.</p><p style=\" font-family: &quot;Noto Sans KR&quot;, sans-serif; color: rgb(34, 34, 34); font-size: 14px; text-align: left\">모두들 뜨거운 참여 감사합니다.</p><p style=\" font-family: &quot;Noto Sans KR&quot;, sans-serif; color: rgb(34, 34, 34); font-size: 14px; text-align: left\"><br /></p><p style=\" font-family: &quot;Noto Sans KR&quot;, sans-serif; color: rgb(34, 34, 34); font-size: 14px; text-align: left\">올해도 화이팅입니다.</p></p>','2024-01-18',0,'0'),
(225,2,'지원팀','우리 회사를 소개합니다. 경영지원부란?','<p><span style=\"font-size: 14px;\">경영지원 직무는 회사의 비전 달성 및 지속가능경영을 위한 각종 경영활동이 올바르게 진행될 수 있도록 조율하는 역할을 담당합니다.</span></p>\r\n<p><span style=\"font-size: 14px;\">회사의 중장기 사업 전략과 목표를 수립하고&nbsp;</span></p>\r\n<p><span style=\"font-size: 14px;\">이를 달성하기 위한 재무 관리와 더불어 전 임직원이 최적의 근무환경에서 업무를 추진할 수 있도록 지원합니다.</span></p>\r\n<p><br /></p>\r\n<p><br /></p>\r\n<p><span style=\"font-size: 14px;\">&lt;경영기획&gt;</span></p>\r\n<p><span style=\"font-size: 14px;\">회사의 비전과 목표를 수립하고 이를 달성하기 위한 실행전략 수립과 혁신 등의 업무를 \r\n담당합니다.&nbsp;</span></p>\r\n<p><span style=\"font-size: 14px;\">또한 대내외 경제 및 자동차 산업 등을 분석하여 글로벌 경영환경을 예측하고\r\n이를 통해 중장기 전략을 수립합니다.</span><br /></p>\r\n<p><br /></p>\r\n<p><span style=\"font-size: 14px;\">&lt;재무회계&gt;</span></p>\r\n<p><span style=\"font-size: 14px;\">회사의 수익창출 및 기업가치 극대화를 실현하기 위해&nbsp;</span></p>\r\n<p><span style=\"font-size: 14px;\">경영성과 분석 및 관리,\r\n자금의 조달 및 운영, 감사보고서 발행, IR 등의 업무를 담당합니다.</span></p>','2024-01-18',0,'0'),
(226,2,'지원팀','[경영지원부] 신규 직원 물품 구매 건','<p>\r\n\r\n<span style=\"color: rgb(60, 65, 68); font-family: &quot;Pretendard Variable&quot;, Pretendard, -apple-system, BlinkMacSystemFont, system-ui, &quot;Segoe UI&quot;, Roboto, Ubuntu, Cantarell, &quot;Noto Sans&quot;, sans-serif, &quot;Helvetica Neue&quot;, &quot;Segoe UI&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 14px; background-color: rgb(255, 255, 255)\">@김대리님, 이번에 신입사원이 5명이 새로 입사하게 되어 가구랑 컴퓨터등등 구입해야 하는데, 지금까지 10개쯤 구입한 것 같은데....&nbsp;</span></p>\r\n<p><span style=\"color: rgb(60, 65, 68); font-family: &quot;Pretendard Variable&quot;, Pretendard, -apple-system, BlinkMacSystemFont, system-ui, &quot;Segoe UI&quot;, Roboto, Ubuntu, Cantarell, &quot;Noto Sans&quot;, sans-serif, &quot;Helvetica Neue&quot;, &quot;Segoe UI&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 14px; background-color: rgb(255, 255, 255)\">각각 언제 구입했는지, 지금은 누가 사용하고 있는지, 현재 상태는 어떤지 좀 정리된 자료가 있을까요?</span>\r\n<br /></p>','2024-01-18',1,'0'),
(227,2,'지원팀','[경영지원부] 사람○ 공고 건','<p><span style=\"color: rgb(60, 65, 68); font-family: &quot;Pretendard Variable&quot;, Pretendard, -apple-system, BlinkMacSystemFont, system-ui, &quot;Segoe UI&quot;, Roboto, Ubuntu, Cantarell, &quot;Noto Sans&quot;, sans-serif, &quot;Helvetica Neue&quot;, &quot;Segoe UI&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 14px; background-color: rgb(255, 255, 255)\">\r\n\r\n<span style=\"color: rgb(60, 65, 68); font-family: &quot;Pretendard Variable&quot;, Pretendard, -apple-system, BlinkMacSystemFont, system-ui, &quot;Segoe UI&quot;, Roboto, Ubuntu, Cantarell, &quot;Noto Sans&quot;, sans-serif, &quot;Helvetica Neue&quot;, &quot;Segoe UI&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 14px; background-color: rgb(255, 255, 255)\">@김대리님</span>\r\n부서 신입사원 채용 공고문은 준비되고 있나요? 언제쯤 사람인에 공고가 나죠?</span>\r\n</p>','2024-01-18',0,'0'),
(228,2,'지원팀','[경영지원부] 지원부 지출 건','<p>\r\n\r\n<span style=\"color: rgb(60, 65, 68); font-family: &quot;Pretendard Variable&quot;, Pretendard, -apple-system, BlinkMacSystemFont, system-ui, &quot;Segoe UI&quot;, Roboto, Ubuntu, Cantarell, &quot;Noto Sans&quot;, sans-serif, &quot;Helvetica Neue&quot;, &quot;Segoe UI&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 14px; background-color: rgb(255, 255, 255)\">@김대리님 이번 달 25 ~ 말일까지 경영 지원 부서에서 지출해야 되는 경비가 얼마나 돼요?</span>\r\n<br /></p>','2024-01-18',0,'0'),
(229,3,'영상/디자인팀','[마케팅부] 사람○ 공고 내용 안내','<p>해당 자격 참고하여 공고 업로드 부탁드립니다.</p>','2024-01-18',1,'0'),
(231,3,'영상/디자인팀','[마케팅부] 이재민 디자이너 포트폴리오 ','<p>확인 바랍니다</p>','2024-01-18',1,'0'),
(232,3,'영상/디자인팀','[마케팅부] 정해리 디자이너 포트폴리오','<p>확인 바랍니다.</p>','2024-01-18',1,'0'),
(233,3,'영상/디자인팀','[마케팅부] 박태석 디자이너 포트폴리오','<p>확인 바랍니다.</p>','2024-01-18',0,'0'),
(234,4,'물류팀','[운영부] 사내 동아리 안내','<p>업무상 접점이 적은 팀원들도 공통의 관심사로 교류할 수 있게끔 사내 동아리 제도를 운영합니다.\r\n많은 참여 부탁드립니다.<br /></p>','2024-01-18',1,'0'),
(235,4,'물류팀','[운영부] 내일채움공재 가입기업 대상 교육바우처 지원사업 안내','<p>\r\n\r\n</p>\r\n우리 회사에 맞는 조건의 정부지원사업을 찾아보고, \r\n적절한 지원사업을 찾으면 제출서류를 준비하여 신청하고, 신청하여 선정되면 사후 사업비 관리하고자 합니다.\r\n팀원들의 노력으로 선정된만큼 지원받을 수 있는 혜택을 최대한 누릴 수 있게끔 돕겠습니다.','2024-01-18',0,'0'),
(236,4,'물류팀','[운영부] 1월 상반기 간식 주문받습니다.','<p>팀 별로 5종류씩 신청해주시면 취합 후 반영하겠습니다.</p>\r\n<p>감사합니다.</p>','2024-01-18',1,'0'),
(237,1,'전사','[2024-01-18] 음악 저작권 지수 업데이트 합니다.','<p>확인바랍니다.</p>','2024-01-18',1,'0'),
(238,1,'전사','[2024-01-18] 추천곡 리스트 업데이트 합니다.','<p>확인 바랍니다.</p>','2024-01-18',6,'0');
